const uint8_t* images[] = {image2_encoded, image3_encoded, image4_encoded, image5_encoded, image6_encoded};
uint32_t lens[] = {IMAGE2_ENCODED_LEN, IMAGE3_ENCODED_LEN, IMAGE4_ENCODED_LEN, IMAGE5_ENCODED_LEN, IMAGE6_ENCODED_LEN};

static uint8_t image_buf[BUFFERSIZE];

// Busy flag for ShowImage() function
uint8_t g_bImageProcessorBusy = 0;

// Current image index
uint8_t g_iCurrentImage = 0;
uint8_t g_bShowImageRequest;

void ShowImage(uint8_t image)
{
	if (g_bImageProcessorBusy)
		return;
	g_bImageProcessorBusy = 1;
	
	uint8_t currentSegment = 0;
	const uint8_t* encoded_image = images[image];
	uint32_t totalbytes = 0;
	
	for (uint32_t j = 0; j < lens[image]; j += 3)
	{
		for (uint8_t i = 0; i < encoded_image[j]; i++)
		{
			image_buf[totalbytes++] = encoded_image[j + 1];
			image_buf[totalbytes++] = encoded_image[j + 2];
			if (totalbytes == BUFFERSIZE)
			{
#ifdef DO_BACKLIGHT_MANIPULATION
				LCD_SetBackLight(LCD, 100); // turn backlight off
#endif
				LCD_DrawImage(LCD, 0, currentSegment * 320 / SEGMENTS_COUNT, 240, 320 / SEGMENTS_COUNT, (uint16_t*)image_buf, 1);
				currentSegment++;
				delay_ms(CROSS_BUFFER_DELAY_MS);
				totalbytes = 0;
			}
		}
	}

#ifdef DO_BACKLIGHT_MANIPULATION
	delay_ms(50);
	LCD_SetBackLight(LCD, 0); // turn it on back
#endif
	
	g_iCurrentImage = image;
	g_bImageProcessorBusy = 0;
	g_bShowImageRequest = 0;
}

void NextImage()
{
	if (g_bImageProcessorBusy)
		return;
	
	if (g_bGIFPlaying)
	{
		g_bGIFStopRequest = 1;
		LCD_SetBackLight(LCD, 100);
		g_iCurrentImage = IMAGE2;
		g_bShowImageRequest = 1;
	}
	else if (g_iCurrentImage < LAST_IMAGE)
	{
			g_iCurrentImage++;
			g_bShowImageRequest = 1;
	}
	delay_ms(200);
}

void PreviousImage()
{
	if (g_bImageProcessorBusy || g_bGIFPlaying)
		return;
	
	if (g_iCurrentImage > 0)
	{
			g_iCurrentImage--;
			g_bShowImageRequest = 1;
	}
	else if (g_iCurrentImage == 0)
	{
		g_bGIFStartRequest = 1;
	}
	delay_ms(200);
}
